import React, { Component } from "react";


const App = () => {
	state = {
		animals: ["lion", "tiger", "hyena", "leopard", "jaguar"],
	};

	return (
		<React.Fragment>
			<h1>Hello World</h1>
			<h2>This is the list of all the animals</h2>
			<ul>{this.state.animals}</ul>
		</React.Fragment>
	);
};

export default App;
